Lex["897"] = "Babulon {bab-oo-lone'}|AV - Babylon 12; 12|of Hebrew origin 0894|TDNT - 1:514,89|n pr loc|Babylon = \"confusion\"<BR>INDENT0--<b>1)</b> a very large and famous city, the residence of the Babylonian kings, situated on both banks of the Euphrates. Cyrus had formerly captured it, but Darius Hystaspis threw down its gates and walls, and Xerxes destroyed the temple of Belis. At length the city was reduced to almost solitude, the population having been drawn off by the neighbouring Seleucia, built on the Tigris by Seleucus Nicanor.INDENT0--<b>2)</b> of the territory of BabyloniaINDENT0--<b>3)</b> allegorically, of Rome as the most corrupt seat of idolatry and the enemy of Christianity";
