Lex["903"] = "Balaam {bal-ah-am'}|AV - Balaam 3; 3|of Hebrew origin 01109|TDNT - 1:524,91|n pr m|Balaam meaning \"perhaps\"<BR>INDENT0--<b>1)</b> A native of Pethor a city in Mesopotamia, endued by Jehovah with prophetic power. He was hired by Balak to curse the Israelites; and influenced by the love of reward, he wished to gratify Balak; but he was compelled by Jehovah's power to bless them. Hence later the Jews saw him as a most abandoned deceiver.";
