Lex["906"] = "ballo {bal'-lo}|AV - cast 86, put 13, thrust 5, cast out 4, lay 3, lie 2, misc 12; 125|a primary word|TDNT - 1:526,91|v|INDENT0--<b>1)</b> to throw or let go of a thing without caring where it fallsINDENT3-- <b>a)</b> to scatter, to throw, cast intoINDENT3-- <b>b)</b> to give over to one's care uncertain about the resultINDENT3-- <b>c)</b> of fluidsINDENT7--<b>1)</b> to pour, pour into of riversINDENT7--<b>2)</b> to pour outINDENT0--<b>2)</b> to put into, insert";
Lex["907"] = "baptizo {bap-tid'-zo}|AV - baptize (76), wash 2, baptist 1, baptized + 2258 1; 80|from a derivative of 911|TDNT - 1:529,92|verb|INDENT0--<b>1)</b> to dip repeatedly, to immerse, to submerge (of vessels sunk)INDENT0--<b>2)</b> to cleanse by dipping or submerging, to wash, to make clean with water, to wash one's self, batheINDENT0--<b>3)</b> to overwhelm<BR>++++<BR> Not to be confused with 911, bapto. The clearest example that shows the meaning of baptizo is a text from the Greek poet and physician Nicander, who lived about 200 B.C. It is a recipe for making pickles and is helpful because it uses both words. Nicander says that in order to make a pickle, the vegetable should first be 'dipped' (bapto) into boiling water and then 'baptised' (baptizo) in the vinegar solution. Both verbs concern the immersing of vegetables in a solution. But the first is temporary. The second, the act of baptising the vegetable, produces a permanent change.<BR> <BR> When used in the New Testament, this word more often refers to our union and identification with Christ than to our water baptism. e.g. Mark 16:16. 'He that believes and is baptised shall be saved'. Christ is saying that mere intellectual assent is not enough. There must be a union with him, a real change, like the vegetable to the pickle! Bible Study Magazine, James Montgomery Boice, May 1989.";
Lex["908"] = "baptisma {bap'-tis-mah}|AV - baptism 22; 22|from 907|TDNT - 1:545,92|n n|INDENT0--<b>1)</b> immersion, submersionINDENT3-- <b>a)</b> of calamities and afflictions with which one is quite overwhelmedINDENT3-- <b>b)</b> of John's baptism, that purification rite by which men on confessing their sins were bound to spiritual reformation, obtained the pardon of their past sins and became qualified for the benefits of the Messiah's kingdom soon to be set up. This was valid Christian baptism, as this was the only baptism the apostles received and it is not recorded anywhere that they were ever rebaptised after Pentecost.INDENT3-- <b>c)</b> of Christian baptism; a rite of immersion in water as commanded by Christ, by which one after confessing his sins and professing his faith in Christ, having been born again by the Holy Spirit unto a new life, identifies publicly with the fellowship of Christ and the church.<BR>++++<BR> In Rom. 6:3 Paul states we are \"baptised unto death\" meaning that we are not only dead to our former ways, but they are buried. To return to them is as unthinkable for a Christian as for one to dig up a dead corpse! In Moslem countries a new believer has little trouble with Moslems until he is publicly baptised. It is then, that the Moslems' know he means business, and then the persecution starts. See also discussion of baptism under No. 907.";
Lex["909"] = "baptismos {bap-tis-mos'}|AV - washing 3, baptism 1; 4|from 907|TDNT - 1:545,92|n m|INDENT0--<b>1)</b> a washing, purification effected by means of waterINDENT3-- <b>a)</b> of washing prescribed by the Mosaic law (Heb 9:10) which seems to mean an exposition of the difference between the washings prescribed by the Mosaic law and Christian baptism";
Lex["910"] = "Baptistes {bap-tis-tace'}|AV - Baptist 14; 14|from 907|TDNT - 1:545,92|n m|INDENT0--<b>1)</b> a baptiserINDENT0--<b>2)</b> one who administers the rite of baptism<BR>INDENT0--<b>3)</b> the surname of John, the forerunner of Christ";
Lex["911"] = "bapto {bap'-to}|AV - dip 3; 3|a primary word|TDNT - 1:529,92|v|INDENT0--<b>1)</b> to dip, dip in, immerseINDENT0--<b>2)</b> to dip into dye, to dye, colour<BR>++++<BR> Not to be confused with 907, baptizo. The clearest example that shows the meaning of baptizo is a text from the Greek poet and physician Nicander, who lived about 200 B.C. It is a recipe for making pickles and is helpful because it uses both words. Nicander says that in order to make a pickle, the vegetable should first be 'dipped' (bapto) into boiling water and then 'baptised' (baptizo) in the vinegar solution. Both verbs concern the immersing of vegetables in a solution. But the first is temporary. The second, the act of baptising the vegetable, produces a permanent change.";
