Lex["4239"] = "praus {prah-ooce'}|AV - meek 3; 3|apparently a primary word|TDNT - 6:645,929|adj|INDENT0--<b>1)</b> mildness of disposition, gentleness of spirit, meekness<BR>++++<BR> Meekness toward God is that disposition of spirit in which we accept His dealings with us as good, and therefore without disputing or resisting. In the OT, the meek are those wholly relying on God rather than their own strength to defend them against injustice. Thus, meekness toward evil people means knowing God is permitting the injuries they inflict, that He is using them to purify His elect, and that He will deliver His elect in His time. (Is. 41:17, Lu. 18:1-8) Gentleness or meekness is the opposite to self-assertiveness and self-interest. It stems from trust in God's goodness and control over the situation. The gentle person is not occupied with self at all. This is a work of the Holy Spirit, not of the human will. (Gal. 5:23)";
