Lex["4990"] = "soter {so-tare'}|AV - Saviour 24; 24|from 4982|TDNT - 7:1003,1132|n m|INDENT0--<b>1)</b> saviour, deliverer, preserver<BR><BR>++++<BR> The name was given by the ancients to deities, esp. tutelary deities, to princes, kings, and in general to men who had conferred signal benefits upon their country, and in more degenerate days by the way of flattery to personages of influence (Wigram). The word <i>soter</i> was a common Greek epithet for the gods (e.g., Zeus, Apollo, and Hermes), active personalities in world affairs (e.g., Epicurus) and rulers (e.g., Ptolemy Philopator, and later Roman Emporers). (cf. LSJ and BDAG)";
